route_of_exposure:
Inhalation (T52, T14) ; oral (T52, T14) ; dermal (T52, T14) ; intravenous (T52, T14)
Orally-administered dalfampridine is rapidly and completely absorbed from the gastrointestinal tract.
Tmax, immediate release form = 1 hour;
Tmax, extended release form = 3.5 hours;
Cmax, 10 mg extended release = 17.3 - 21.6 ng/mL;
Relative bioavailability of 10 mg extended-release tablets compared to aqueous oral solution = 96%

Oral.
In clinical studies, carbamazepine suspension, conventional tablets, and extended-release tablets delivered equivalent amounts of drug to the systemic circulation. However, it has been observed that the suspension is somewhat faster absorbed. Furthermore, the extended-release tablet is slightly slower than the conventional tablet. The bioavailability of the extended-release tablet is 89%, compared to the suspension. Plasma levels of carbamazepine are variable. The time to peak concentration for the different formulations are as follows:
Suspension = 1.5 hours;
Conventional tablets = 4-5 hours;
Extended-release tablets = 3-12 hours.

Rapidly absorbed following oral administration, absorption is comparable between neonates, infants, and children.
Cmax, 50 mg/kg dose, neonates= 14 mg/L;
Tmax, 50 mg/kg dose, neonates = 2.1 hours;
However, extent of absorption is higher and elimination half life is longer in neonates compared to children and infants. This is because neonates have reduced renal function compared to the aforementioned population groups.
AUC, 50 mg/kg dose, neonates = 142.6 &#177; 44.0 mg/L/hr;
Food may slightly decrease the rate (Cmax decreased by 33%, Tmax increased to 2 hours), but not the extent of absorption. Furthermore, vigabatrin does not cross the blood-brain-barrier well, thus high doses are needed.

Oral, Ophthalmic. Tmax, after single dose, opthalmic = 1.2 hours;
Cmax, 1.5%, opthalmic dose = 7.3 &#177; 1.9  ng/mL;
After 24 hours post-installation, levels of bepotastine are below quantifiable limit of 2 ng/mL. Minimal systemic absorption with opthalmic dosage form.
